-- Institution
  INSERT INTO Office(
  UUID, code, short_name, office_name, date_stablished, type_id, parent_id, alternate_id, 
  address_detail, address_url, geography_id, cid_sequence)
SELECT 
  a.UUID, a.code, a.OfficeName short_name, a.OfficeName office_name, a.DateStablished date_stablished, 
  typ.ID Type_id, o.ID parent_id, a.AlternateID alternate_id, 
  a.AddressDetail address_detail, NULL address_url, g.ID geography_id, 0 cid_sequence
FROM
  staging.Office a
INNER JOIN vwReference typ on typ.Title = a.OfficeType and typ.ref_type = 'OfficeType'
LEFT JOIN Office o on o.UUID = a.ParentUUID
LEFT JOIN LATERAL SearchLocation(a.Municipality || ' ' || a.Province,1) g ON true
WHERE a.officetype = 'Institution'

ON CONFLICT (UUID) DO UPDATE SET
  code = EXCLUDED.code,
  short_name = EXCLUDED.short_name,
  office_name = EXCLUDED.office_name,
  date_stablished = EXCLUDED.date_stablished,
  type_id = EXCLUDED.type_id,
  parent_id = EXCLUDED.parent_id,
  alternate_id = EXCLUDED.alternate_id,
  address_detail = EXCLUDED.address_detail,
  address_url = EXCLUDED.address_url,
  geography_id = EXCLUDED.geography_id,
  cid_sequence = EXCLUDED.cid_sequence;


